import React, { Component } from 'react';
import { StyleSheet, Text, View, Linking } from 'react-native';

class Boxes extends Component {
  render(){
    return (
            <View style={styles.container}>
            <View style={styles.box}>
                <View style={styles.inner}>
                    <Text>Box1</Text>
                </View>
            </View>
            <View style={styles.box}>
                <View style={styles.inner}>
                    <Text>Box1</Text>
                </View>
            </View>
            <View style={styles.box}>
                <View style={styles.inner}>
                    <Text>Box1</Text>
                </View>
            </View>
            <View style={styles.box}>
                <View style={styles.inner}>
                    <Text>Box1</Text>
                </View>
            </View>
            </View>
    );
  }

}

const styles = StyleSheet.create({
  container: {
    width: '100%',
    height: '85%',
    padding: 5,
    flexDirection: 'row',
    flexWrap: 'wrap'
  },
  box: {
    width: '50%',
    height: '25%',
    padding: 5,
    // padding: "10"
    // margin: "10 px"
  },
  inner: {
    flex: 1,
    backgroundColor: '#eee',
    alignItems: 'center',
    justifyContent: 'center'
  }
});

export default Boxes;
